import React from "react";
import {Tile} from '../tile/Tile.js'

export const TileList = (tiles) => {
  return (
    <div>
      <ul>
      {tiles.map((contact) => (
        <Tile key={contact} tile={Tile} />
      ))}
      </ul>
      
    </div>
  );
};
